}

public void allowEditMaxQty()
{
    MaxQty_MaxQty_Qty.allowEdit(TmpContractLine.MaxQty_MustApplyMaxQty);
    Transport_Transport_MaxQty.allowEdit(TmpContractLine.Transport_MustApplyMaxQty);
    Rigging_Rigging_MaxQty.allowEdit(TmpContractLine.Rigging_MustApplyMaxQty);
    TmpContractLine_ReturnTransport_MaxQty.allowEdit(TmpContractLine.ReturnTransport_MustApplyMaxQty);
}

public RAGContractData getFormClass()
{
    return formClass;
}

public void allowEditPrice()
{
    Transport_Transport_Price.allowEdit(!TmpContractLine.Transport_UseRentalTypePrice);
    Rigging_Rigging_Price.allowEdit(!TmpContractLine.Rigging_UseRentalTypePrice);
    TmpContractLine_ReturnTransport_Price.allowEdit(!TmpContractLine.ReturnTransport_UseRentalTypePrice);

}

void deleteAgreement(RAGAgreementType _agmtType2Delete)
{
    TmpContractLine.deleteAgreement(_agmtType2Delete, contractIdRange); 

    // repopulate the temporary table
    formClass.populateContractLines();
    TmpContractLine.linkPhysicalTableInstance(formClass.getContractLineTmpTable());
    TmpContractLine_ds.research(true);
}

[SuppressBPWarningAttribute("BPCheckInvalidInitFormMethodWarning", "initialization  of caller & form must be performed before invoking super()")]
public void init()
{
    skipTierCalculationOnInit = true;
    element.initCaller();
    element.initFormClass();

    super();

    agmtTypeFieldIdsMap = RAGTmpContractLine::agmtTypeFieldIdsMap();
    parameters = RAGParameters::find();

    element.initDesign();
}

private void initCaller()
{
    RAGContractView contractView;

    switch(element.args().dataset())
    {
        case tableNum(RAGContractTable):
            contractTable = element.args().record();
            break;

        case tableNum(RAGContractView):
            contractView = element.args().record();
            contractTable = RAGContractTable::find(contractView.ContractId);
            break;

        default:
            throw error(strFmt("@DNR3705", element.name(), tableStr(RAGContractTable), tableStr(RAGContractView)));
    }
}

private void initDesign()
{
    ContractTable_ContractType.selection(contractTable.ContractType);
    ContractTable_CurrencyCode.text(contractTable.CurrencyCode);

    if(parameters.PriceTierTimeUnit1)
    {
        displayPriceInUnit1.label(strFmt("%1 %2", UnitOfMeasure::find(parameters.PriceTierTimeUnit1).Symbol, strLwr("@SYS11865")));
        displayPriceInUnit1.visible(true);
    }
    if(parameters.PriceTierTimeUnit2)
    {
        displayPriceInUnit2.label(strFmt("%1 %2", UnitOfMeasure::find(parameters.PriceTierTimeUnit2).Symbol, strLwr("@SYS11865")));
        displayPriceInUnit2.visible(true);
    }
    if(parameters.PriceTierTimeUnit3)
    {
        displayPriceInUnit3.label(strFmt("%1 %2", UnitOfMeasure::find(parameters.PriceTierTimeUnit3).Symbol, strLwr("@SYS11865")));
        displayPriceInUnit3.visible(true);
    }
    if(parameters.PriceTierTimeUnit4)
    {
        displayPriceInUnit4.label(strFmt("%1 %2", UnitOfMeasure::find(parameters.PriceTierTimeUnit4).Symbol, strLwr("@SYS11865")));
        displayPriceInUnit4.visible(true);
    }
    if(parameters.PriceTierTimeUnit5)
    {
        displayPriceInUnit5.label(strFmt("%1 %2", UnitOfMeasure::find(parameters.PriceTierTimeUnit5).Symbol, strLwr("@SYS11865")));
        displayPriceInUnit5.visible(true);
    }

    TmpContractLine_ds.allowEdit(contractTable.Status < RAGContractStatus::Canceled);

}

private void initFormClass()
{
    RAGContractDataParm contractDataParm;
    contractDataParm.initFromContractTable(contractTable);
    contractDataParm.forceInactiveContract(contractTable);
    contractDataParm.MustPopulateNames = NoYes::Yes;
    contractDataParm.MustPopulateAllTierTypes = NoYes::Yes;

    formClass = new RAGContractData();
    formClass.parmDataParm(contractDataParm);


    if (skipTierCalculationOnInit)
    {
        formClass.populateContractLines();
    }
    else
    {
        formClass.populateData();
    }

    contractIdRange = contractDataParm.contractHierarchyRange();
}

public int task(int _taskId)
{
    int ret;
    ;

    if(_taskId == 2839)
    {
        ret = 0; // The CTRL+F5 action messes up the temporary table
    }
    else
    {
        ret = super(_taskId);
    }

    return ret;
}

public void write()
{
    RAGContractLevel currentLevel = TmpContractLine.ContractLevel;
    ;

    TmpContractLine.modifyTmpContractLine();

    super();

    if (currentLevel == RAGContractLevel::RentalType)
    {
        this.refresh();
    }
    else
    {
        // repopulate the temporary table
        formClass.populateContractLines();
        TmpContractLine.linkPhysicalTableInstance(formClass.getContractLineTmpTable());
        this.research(true);
    }
}

public void init()
{
    super();

    this.query().dataSourceTable(tableNum(RAGTmpContractLine)).clearDynalinks();

    TmpContractLine.linkPhysicalTableInstance(formClass.getContractLineTmpTable());
}

public int active()
{
    int ret = super();

    this.updateDesign();

    if (skipTierCalculationOnInit)
    {
        formClass.getContractTiers(TmpContractLine.ContractId, TmpContractLine.ContractLevel, TmpContractLine.RentalTypeRelation, RAGAgreementType::PriceTier, TmpContractLine_PriceTier);
        TmpContractLine_PriceTier_ds.executeQuery();

        formClass.getContractTiers(TmpContractLine.ContractId, TmpContractLine.ContractLevel, TmpContractLine.RentalTypeRelation, RAGAgreementType::TransportTier, TmpContractLine_TransportTier);
        TmpContractLine_TransportTier_ds.executeQuery();
    }

    return ret;
}

public void updateDesign()
{
    boolean         allowEdit;
    MapEnumerator   enumerator = agmtTypeFieldIdsMap.getEnumerator();
    container       fieldIds;
    Counter         conCounter;
    ;


    // enable/disable agreement type fields as per settings in RAGAgreementTypeSetup
    while(enumerator.moveNext())
    {
        allowEdit = RAGAgreementTypeSetup::isActive(enumerator.currentKey(), TmpContractLine.ContractLevel);
        fieldIds = enumerator.currentValue();

        for(conCounter = 1; conCounter <= conLen(fieldIds); conCounter ++)
        {
            TmpContractLine_ds.object(conPeek(fieldIds, conCounter)).allowEdit(allowEdit);
        }
    }

    DeleteGrossPrice.visible(TmpContractLine.GrossPrice_isOverridden);
    DeleteDiscount.visible(TmpContractLine.Discount_isOverridden);
    DeleteNetPrice.visible(TmpContractLine.NetPrice_isOverridden);
    DeleteInsurance.visible(TmpContractLine.Insurance_isOverridden);
    DeleteInsurancePct.visible(TmpContractLine.InsurancePct_isOverridden);
    DeleteTransport.visible(TmpContractLine.Transport_isOverridden);
    DeleteReturnTransport.visible(TmpContractLine.ReturnTransport_isOverridden);
    DeleteWarranty.visible(TmpContractLine.Warranty_isOverridden);
    DeleteMinQty.visible(TmpContractLine.MinQty_isOverridden);
    DeleteMaxQty.visible(TmpContractLine.MaxQty_isOverridden);
    DeleteRigging.visible(TmpContractLine.Rigging_isOverridden);

    TmpContractLine_PriceTier_ds.updateDesign();
    TmpContractLine_TransportTier_ds.updateDesign();

    element.allowEditMaxQty();
    element.allowEditPrice();

}

