public void updateDesign()
{
    // only allow creation/deletion of tiers on the contract level of default contracts
    TmpContractLine_PriceTier_ds.allowEdit(contractTable.Status < RAGContractStatus::Canceled);
    TmpContractLine_PriceTier_ds.allowCreate(contractTable.ContractType == RAGContractType::Default &&
                                             TmpContractLine.ContractLevel == RAGContractLevel::Contract &&
                                             contractTable.Status < RAGContractStatus::Canceled);

    DeletePriceTier.enabled(TmpContractLine_PriceTier.isOverridden &&
                            contractTable.Status < RAGContractStatus::Canceled);
}

public void write()
{
    RAGTmpContractLineTier          tmpTier;
    RAGContractLine                 contractLineDB;
    RAGContractLineModification     action;
    RAGTmpContractLineTier          tmpContractLineTier;
    ;

    tmpTier = this.cursor();
    action = (tmpTier.RecId == 0 ? RAGContractLineModification::Insert : RAGContractLineModification::Update);

    // determine if any unique keys have been violated
    super();

    // update records in database
    switch (action)
    {
        case RAGContractLineModification::Insert:
            contractLineDB = tmpTier.createContractTier();
            break;

        case RAGContractLineModification::Update:
            contractLineDB = tmpTier.modifyContractTier();
            break;
    }

    if (tmpTier.ContractLevel != RAGContractLevel::RentalType)
    {
        // repopulate the temporary table
        formClass.populateContractLines();
        TmpContractLine.linkPhysicalTableInstance(formClass.getContractLineTmpTable());

        if (action == RAGContractLineModification::Insert)
        {
            tmpContractLineTier.data(TmpContractLine_PriceTier.data());
        }
    }

    if (tmpContractLineTier)
    {
        // sometimes after inserting a new tier and using research(true) only 1 or few tiers is shown.
        element.args().lookupRecord(tmpContractLineTier);
        this.research();
    }
    else
    {
        this.research(true);
    }
}

public void init()
{
    QueryBuildDataSource qbds;
    ;

    super();

    if (skipTierCalculationOnInit)
    {
        this.linkType(DataSourceLinkTypePropertyValues::Passive);
    }
    else
    {
        this.linkType(DataSourceLinkTypePropertyValues::Delayed);
        TmpContractLine_PriceTier.linkPhysicalTableInstance(formClass.getContractTierTmpTable());
    }

    qbds = this.query().dataSourceTable(tableNum(RAGTmpContractLineTier));
    qbds.addRange(fieldNum(RAGTmpContractLineTier, AgreementType)).value(SysQuery::value(RAGAgreementType::PriceTier));

    qbds.addSortField(fieldNum(RAGTmpContractLineTier, TierPeriod));
    qbds.addSortField(fieldNum(RAGTmpContractLineTier, NumOfTierPeriods));
}

display RAGGrossPrice displayGrossPrice(RAGTmpContractLineTier _tmpTier)
{
    RAGGrossPrice price;

    if (hasFieldAccess(tableNum(RAGTmpContractLine), fieldNum(RAGTmpContractLine, GrossPrice_Price)))
    {
        price = TmpContractLine.GrossPrice_Price * _tmpTier.Multiplier;
    }

    return price;
}

