}

display RAGTransportPrice displayReturnTransportPrice(RAGTmpContractLineTier _tmpTier)
{
    RAGTransportPrice price;
    ;

    if(hasFieldAccess(tablenum(RAGTmpContractLine), fieldnum(RAGTmpContractLine, ReturnTransport_Price)))
    {
        price = (TmpContractLine.ReturnTransport_AddTransport ? TmpContractLine.ReturnTransport_Price * _tmpTier.Multiplier : 0);
    }

    return price;
}

