void clicked()
{
    super();

    if (TmpContractLine_PriceTier.deleteContractTier(formClass.parmDataParm()))
    {
        if (skipTierCalculationOnInit)
        {
            formClass.getContractTiers(TmpContractLine.ContractId, TmpContractLine.ContractLevel, TmpContractLine.RentalTypeRelation, RAGAgreementType::PriceTier, TmpContractLine_PriceTier);
        }
        else
        {
            formClass.populateContractTiers();
            TmpContractLine_PriceTier.linkPhysicalTableInstance(formClass.getContractTierTmpTable());
        }

        TmpContractLine_PriceTier_ds.research(true);
    }
}

